import React from 'react';
import { Navbar } from "@nextui-org/react";

function MyNavbar() {
  return (
    <div>
      <Navbar isBordered variant={'sticky'}>
        <Navbar.Brand>
          Hello
        </Navbar.Brand>
        <Navbar.Content>
          hi
        </Navbar.Content>
      </Navbar>
    </div>
  );
}

export default MyNavbar;
